import { Link, Page } from 'components';
import React from 'react';

export const Home: React.FC = () => {
  return (
    <Page>
      <div>
        HTML+
        <ul>
          <li>Docs</li>
          <li>Pricing</li>
          <li>
            <Link to="ROUTE:COMPONENT:DETAILS" params={{ key: 'switch' }}>
              Components
            </Link>
          </li>
          <li>v1.2.7</li>
        </ul>
        <ul>
          <li>github</li>
          <li>twitter</li>
          <li>instagram</li>
        </ul>
      </div>
    </Page>
  );
};
